import React, { useEffect, useState } from 'react';
import SideNavbar from '../../Components/SideNavbar';
import TableComponents from '../../Components/TableComponents';
import { THead, TBody } from '../../dataDummy/teachers';

export default function Teachers() {
  const [TBodyTeachers, setTBodyTeachers] = useState(TBody);

  useEffect(() => {
    fetch('src/dataDummy/students.js')
      .then((response) => response.json())
      .then((data) => console.log(data));
  }, []);

  const handleEdit = (updatedStudent) => {
    setTBodyTeachers((prevStudents) =>
      prevStudents.map((student) =>
        student.id === updatedStudent.id ? updatedStudent : student,
      ),
    );
  };

  const handleDelete = (id) => {
    setTBodyTeachers((prevStudents) =>
      prevStudents.filter((student) => student.id !== id),
    );
  };

  const handleAdd = (dataStudent) => {
    setTBodyTeachers((prevStudents) => [
      ...prevStudents,
      { ...dataStudent, id: prevStudents.length + 1 },
    ]);
  };

  return (
    <div class='row'>
      <SideNavbar />

      <div class='col-10 pt-5'>
        <h2 className='text-center'>Teachers</h2>
        <div className='dashboard-content'>
          <TableComponents
            thead={THead}
            tbody={TBodyTeachers}
            buttonName={'Add New Teacher'}
            handleDelete={handleDelete}
            handleAdd={handleAdd}
            handleEdit={handleEdit}
          />
        </div>
      </div>
    </div>
  )
}
